import React from 'react';
import {Switch, Route, Link} from 'react-router-dom';

 import Words from './pages/Words';


 const App = () => {
  return (
    <>
      <header>
        <nav>
          <Link to='/'>Saved</Link>
        </nav>
      </header>

      <main>
        <Switch>
          <Route exact path="/" 
            render={ routeProps => <Words {...routeProps} />}
          />
        </Switch>
      </main>
    </>
  );
}

export default App;
